import React, { useEffect } from 'react'
import { getTableData } from '../api'

function Table() {
    useEffect(() => {
        getTableData()
            .then(res => {
                console.log("Table data")
                console.log(res)
            })
    }, [])
    return (
        <div>Table</div>
    )
}

export default Table
